import * as React from "react";
import classNames from "classnames";
import { useTheme } from "next-themes";

import { Block, Text as TextPrimitive, InlineText } from "~/components/primitive";
import { useDidMount, useDocumentTitle } from "~/hooks";
import type { T_ReactChildren, T_ReactElement } from "~/types";

function MariaCamila(): T_ReactElement {
	// hooks
	const { theme, setTheme } = useTheme();

	// effects
	useDidMount(() => {
		if (theme === "dark") setTheme("light");
	});

	useDocumentTitle("Feliz cumple!!");

	return (
		<Block className="tw-mx-auto tw-max-w-lg tw-p-6">
			<Title className="tw-mb-12">
				🎉
				<br />
				Feliz cumpleaños!
				<br />
				Maria Camila
				<br />
				👩‍⚕️
			</Title>

			<Text
				emoji="🤓"
				left
			>
				Se que esto es muy <Marked>nerd</Marked>
			</Text>

			<Text emoji="🙁">
				Que no hubo <Marked>frisby</Marked> o <Marked>cartica</Marked> este año
			</Text>

			<Text
				emoji="👧"
				left
			>
				Que ayer te dije que todavía no eras una <Marked>bichota</Marked>
			</Text>

			<Text emoji="👸">
				Pero creo que ya lo <Marked>eres!</Marked>
			</Text>

			<Block className="tw-my-8">
				<Image />
				<TextPrimitive className="tw-mt-1 tw-px-4 tw-text-center tw-text-sm tw-italic">
					esta es la única foto <br /> que tengo de los dos juntos 🤷‍♂️
				</TextPrimitive>
			</Block>

			<hr className="tw-mt-10 tw-h-px tw-border tw-border-dashed tw-border-yellow-200 tw-opacity-50 tw-shadow-md" />

			<Block className="tw-my-8">
				<Title className="tw-mb-4">
					Te deseo que la pases muy bien y admiro mucho tu profesión 🤩
				</Title>
				<iframe
					src="https://www.youtube.com/embed/MIur6bNcwHA"
					height="315"
					width="100%"
					allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
					frameBorder="0"
					loading="lazy"
					title="YouTube video player"
					allowFullScreen
				/>
			</Block>

			<style jsx>
				{`
					:global(body) {
						@apply tw-bg-yellow-100;
					}
				`}
			</style>
		</Block>
	);
}

export default MariaCamila;

// --- Components ---

function Text({
	children,
	emoji,
	left = false,
}: {
	children: T_ReactChildren;
	emoji: string;
	left?: boolean;
}): T_ReactElement {
	return (
		<Block
			className={classNames(
				"tw-my-6 tw-flex tw-items-center tw-text-lg",
				left ? "tw-pr-10 tw-text-left" : "tw-flex-row-reverse tw-pl-10 tw-text-right",
			)}
		>
			<InlineText className="tw-flex-shrink-0 tw-text-3xl">{emoji}</InlineText>
			<InlineText className="tw-mx-3">{children}</InlineText>
		</Block>
	);
}

function Marked({ children }: { children: T_ReactChildren }): T_ReactElement {
	return (
		<u>
			<b>{children}</b>
		</u>
	);
}

function Title({
	children,
	className,
}: {
	children: T_ReactChildren;
	className: string;
}): T_ReactElement {
	return (
		<h1 className={classNames("tw-text-center tw-text-3xl tw-font-bold", className)}>{children}</h1>
	);
}

function Image(): T_ReactElement {
	return (
		<img
			className="tw-rounded-tr-md tw-rounded-bl-md tw-border-8 tw-border-black tw-shadow-md"
			alt="Foto"
			src="data:image/jpeg;base64,"
		/>
	);
}
